A teljes CourseDisplay lényegében egy ItemsControl , amely a világ WorldObjects tulajdonságához van kötve. Ezen belül található egy Canvas , amire a rajzolás történik, valamint egy DataTemplate , amely azt írja le, hogy egy WorldObject típusú objektumok hogyan kell kezelni. A világelemhez tartozó képet kell kirajzolni, így tartalmaz egy Image -et, amelynek forrása a WorldObject Filename tulajdonsága. A Converter attribútumon keresztül meg lehet hívni egy függvényt, amellyel akár befolyásolni lehet a rajzolást (transzformálás). A WorldObject -az alkalmazás szempontjából- a világ minden elemének őse, de ennél specializáltabban is lehet definiálni template -eket. Az alábbi kódrészlet szétbontja Circle és AutomatedCar típusokra, előbbihez nem is képet tölt be, hanem közvetlenül rajzol a Canvas -re. Az utóbbi esetben egyrészt a fentivel megegyező módon betölt egy képet, valamit arra kirajzol egy poligont (ez a debug funkcióknál kell majd). <ItemsControl Name="CourseDisplay" ItemsSource="{Binding WorldObjects, Mode=OneWay}" Width="{Binding Width, Mode=OneWay}" Height="{Binding Height, Mode=OneWay}" HorizontalAlignment="Left" VerticalAlignment="Top" > <ItemsControl.ItemContainerStyle> <Style TargetType="ContentPresenter"> <Setter Property="Canvas.Left" Value="{Binding X}"/> <Setter Property="Canvas.Top" Value="{Binding Y}"/> <Setter Property="Canvas.ZIndex" Value="{Binding ZIndex}"/> </Style> </ItemsControl.ItemContainerStyle> <ItemsControl.ItemsPanel> <ItemsPanelTemplate> <Canvas /> </ItemsPanelTemplate> </ItemsControl.ItemsPanel> <ItemsControl.Resources> <DataTemplate DataType="{x:Type models:Circle}"> <Canvas> <Ellipse Fill="black" Width="{Binding Width}" Height="{Binding Height}" Panel.ZIndex="10"/> </Canvas> </DataTemplate> <DataTemplate DataType="{x:Type models:AutomatedCar}"> <Canvas> <Image Width="{Binding Width}" Height="{Binding Height}" Source="{Binding Filename, Converter={x:Static visualization:WorldObjectTransformer.Instance}}"/> <Polyline Stroke="red" Points="{Binding Geometry.Points, Mode=OneWay}" /> </Canvas> </DataTemplate> </ItemsControl.Resources>
</ItemsControl> A skeletonban esetben az objektum nem a képet tárolja, hanem a képfájl nevét (Filename, ez van a Source-hoz kötve), a fájlnévből pedig egy konverter segítségével kap a megjelenítés képet. Ráadásul nem is tölti be minden esetben a képfájlokat, hanem gyorsító-tárazza azokat fájlnév alapján egy Dictionary segítségével. A WorldObjectTransformer singleton, hogy ez a mechanizmus megfelelően működhessen. public class WorldObjectTransformer : IValueConverter
{ private static Dictionary<string, BitmapImage> cache = new Dictionary<string, BitmapImage>(); public static WorldObjectTransformer Instance { get; } = new WorldObjectTransformer(); static BitmapImage GetCachedImage(string filename) { if (!cache.ContainsKey(filename)) { var image = new BitmapImage(new Uri($"src/AutomatedCar/Assets/WorldObjects/{filename}", UriKind.Relative)); image.Freeze(); cache.Add(filename, image); } return cache[filename]; } public object Convert(object value, Type targetType, object parameter, CultureInfo culture) => GetCachedImage((string)value);
} Megfigyelhető továbbá, hogy az AutomatedCar template esetében nem csak a kép van kirajzolva, hanem egy poligon ez, ez az objektum poligon váza, amelyet pl. ütközésekhez kell majd felhasználni. Előbb a kép, majd rá a polyline kerül kirajzolásra. Az ilyen poligonok megjelenítése debug funkciókét a megjelenítés feladata. A rajzolás pedig egy logikai értékhez kapcsolható... Pozicionálás Megfigyelhető, hogy a fenti példán, hogy a ItemsControl.ItemContainerStyle rendelkezik az objektumok pozíciójáról. Ezt CSS-szerűen működő stílusokkal lehet megadni. Az ItemsControl elemei (a WorldObject-ek) X , Y és ZIndex tulajdonságához van kötve a ContentPresenter Canvas Left , Top és ZIndex attribútuma. Az alábbi ábrán látható a futó alkalmazás: bal oldalt a kezdetleges CourseDisplay, jobb oldalt a kezdetleges Dashboard. Az autó az (50, 50) pozícióba van kirajzolva, a kör a (400, 200) koordinátákra (bal felső sarokkal értendő) ezek különbségét pedig kiszámolta a DummySensor és leolvasható a műszerfalról.
